style.css:
/* i really want this to be global */

/* Dark Begin */
 .dark-theme .section-content {
    background-color: rgb(222, 111, 161);
    color: #fff;
}
.dark-theme {
    background-image: url(https://i.ytimg.com/vi/uFeGl428_QY/maxresdefault.jpg);
    color: rgb(255, 255, 255);
}
.dark-theme .rbx-header {
    background-color: rgb(222, 111, 161);
    border: solid rgb(222 123 156);
    border-width: 0 0 1px;
}
.dark-theme .content {
    background-image: url(https://i.ytimg.com/vi/uFeGl428_QY/maxresdefault.jpg);
    color: #fff;
}
/* Chat */
 .dark-theme .chat-main {
    background-color: rgb(222, 111, 161);
    color: #fff;
}
.dark-theme .dialogs .dialog-container .dialog-message-container.message-inbound .dialog-triangle:before {
    border-width: 0 4px 4px 0;
    border-color: transparent #ff45c9 transparent transparent;
}
.dark-theme .dialogs .dialog-container .dialog-message-container.message-inbound .dialog-triangle:after {
    border-width: 0 4px 4px 0;
    border-color: transparent #ff45c9 transparent transparent;
}
.dark-theme .dialogs .dialog-container .dialog-message-container.message-inbound .dialog-message {
    background-color: #ff45c9;
    color: #fff;
    border: 1px solid #ff45c9;
}
.dark-theme .dialogs .dialog-container .dialog-message-container .dialog-message {
    background-color: #f79aff;
    border: 1px solid #f79aff;
    color: #fff;
}
.dark-theme .dialogs .dialog-container .dialog-message-container.message-cluster-master .dialog-triangle:before {
    border-color: transparent transparent transparent #f79aff;
}
.dark-theme .dialogs .dialog-container .dialog-message-container.message-cluster-master .dialog-triangle:after {
    border-color: transparent transparent transparent #f79aff;
}
.dark-theme .dialog-container {
    background-color: rgb(222, 111, 161);
    color: #fff;
}
.dark-theme .dialogs .dialog-container .dialog-header {
    background-color: rgb(255, 118, 142);
}
.dark-theme .chat-container .chat-main .chat-header {
    background-color: rgb(255, 118, 142);
}
.dark-theme .dialogs .dialog-container .dialog-body {
    background: rgba(222, 111, 161);
    color: #fff;
}
.dark-theme .dialog-container .dialog-input-container .dialog-input {
    background: rgba(187, 118, 255, 0.7);
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}

.dark-theme .dialog-container .dialog-input-container .dialog-input:focus {
    background-color: rgb(184, 57, 255, .7);
    border-color: hsla(0, 0%, 100%, .3);
}
.dark-theme .input-field:focus {
    background: rgba(184, 57, 255, 0.85);
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}

.dialog-input {
    background-color: rgb(187 118 255, 0.7);
    border-color: hsl(302deg 100% 62% / 20%);
    color: #8a8a8a;
    border-radius: 8px;
}
.dark-theme .input-field {
    background: rgba(198, 139, 255, 0.85);
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}
.dark-theme .dialog-container .dialog-input-container {
    background-color: rgb(187, 118, 255, 0.7);
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}
/* Bars */
 .dark-theme .rbx-left-col {
    box-shadow: 0 0 8px 0 rgba(0, 0, 0, .3);
    background-color: rgb(222, 111, 161);
}
.dark-theme .input-group .input-field {
    background-color: rgb(228, 146, 183);
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}
.dark-theme .container-footer {
    background-color: rgb(222, 111, 161);
}
.dark-theme .rbx-tabs-vertical .category-tabs .menu-vertical {
    background-color: #ff666c;
    color: #fff;
}
.dark-theme .thumbnail-2d-container {
    border: 0;
    background-color: rgba(255, 97, 108, 0.5);
    border-color: #393b3d;
}

.dark-theme .input-group .input-field:focus {
    background-color: rgb(179 101 136);
    border-color: hsla(0, 0%, 100%, .2);
    color: #bdbebe;
    border-radius: 8px;
}

.dark-theme .asset-thumb-container {
    background-color: rgba(255, 97, 108,.5);
    border: 0;
}

.dark-theme.btr-profile .btr-games-list .btr-game-button {
    background-color: #ff387c;
    border-color: #ff216d;
}

/* Scroll */
 .dark-theme .scroller:focus, .dark-theme .scroller:hover {
    background-color: rgba(255, 20, 147, .3);
}
.dark-theme .scroller.disabled {
    background-color: rgba(255, 20, 147, .5);
    color: rgb(255, 255, 255);
    border: none;
}
.dark-theme .scroller {
    background-color: rgba(255, 20, 147, .5);
    color: rgb(255, 255, 255);
    border: none;
}
.dark-theme .horizontal-scroller .scroller .spacer {
    background-color: rgba(255, 20, 147, .5);
    color: rgb(255, 255, 255);
}

.dark-theme .avatar-container img {
    background-color: #ff9498;
}

.dark-theme .table {
    background: url(https://i.ytimg.com/vi/uFeGl428_QY/maxresdefault.jpg);
    color: #fff;
}
